import React, { useEffect, useState } from 'react';
import { Typography, Box, List, ListItem, ListItemText } from '@mui/material';

export default function StatsPage() {
  const [urls, setUrls] = useState([]);

  useEffect(() => {
    const data = JSON.parse(localStorage.getItem('urls')) || [];
    setUrls(data);
  }, []);

  return (
    <Box p={2}>
      <Typography variant="h5">Shortened URLs Stats</Typography>
      <List>
        {urls.map((url, idx) => (
          <ListItem key={idx} divider>
            <ListItemText
              primary={`${url.shortUrl}`}
              secondary={`Original: ${url.original}
Created: ${new Date(url.createdAt).toLocaleString()}
Expires: ${new Date(url.expiresAt).toLocaleString()}
Clicks: ${url.clicks.length}`}
            />
          </ListItem>
        ))}
      </List>
    </Box>
  );
}
